import React from 'react';

const SideSummaryDish = props => {
    return (
        <div>
            <span>{props.dishName}</span>
            <span>{props.unitPrice}</span>
            <span>*</span>
            <span>{props.indivdualDishNum}</span>
            <span>=</span>
            <span>{props.price}</span>
        </div>
    )
}
export default SideSummaryDish;
